def find_min_moves_for_black_square(n, m, moves):
    """"""
    moves_count = [[0] * (n + 4) for _ in range(n + 4)]
    for (i, (x, y)) in enumerate(moves):
        for a in range(x, x + 3):
            for b in range(y, y + 3):
                moves_count[a][b] += 1
                if moves_count[a][b] == 9:
                    return i + 1
    return -1
